<!doctype html>
<html>
<head>
    <meta charset="UTF-8" />
    <meta name="keywords" content="HTML,CSS,XML,JavaScript">
    <title>Fun with Ads</title>
    <link rel="stylesheet" type="text/css" href="desktop.css"></style>
	<script src="http://ajax.googleapis.com/ajax/libs/jquery/1.11.2/jquery.min.js"></script>
	<script src="jGravity-min.js"></script>
	<script>
    $(document).ready(function() {
              $('body').jGravity({
                   target: 'div',
                   ignoreClass: 'ignoreMe',
                   weight: 50,
                   depth: 50,
                   drag: true
            });
        });
	</script>
</head>
<body>
<center>
</center>

	<div class="midddle">
		<iframe src="http://hackertyper.net/" width="100%" height="225" frameborder="0" style="border:0">
		</iframe>
		<ul class="li">
		</ul>
	</div>
</body>
</html>
